import React from "react";
import logo from "../assets/logoJC.jpg";

import linkedin from "../assets/linkedinLogo.png";
import codewars from "../assets/codewarsLogo.png";
import "../styles/Banner.css";
import jsonData from '../data/data.json';

function Banner() {
  const githubLogo = require(jsonData.frameworks.github.logo);
  return (
    <div className="cv-banner">
      <a href="#"><img src={logo} alt="La maisonjungle" className="logoBanner"/></a>
      <nav>
        <ul className="nav-links">
          <li>
            <a href="#languages">{jsonData.francais.titreLanguage}</a>
          </li>
          <li>
            <a href="#portfolio">Portfolio</a>
          </li>
          <li>
            <a href="#diplomas">{jsonData.francais.titreFormation}</a>
          </li>
          <li>
            <a href="#jobs">{jsonData.francais.titreExperience}</a>
          </li>
          <li>
            <a href="#contacts">Contacts</a>
          </li>
        </ul>
      </nav>
      <div className="social-banner">
        <a href={jsonData.informations.github} target="_blank"><img src={jsonData.frameworks.pandas.logo} className="logo" /></a>
        <a href={jsonData.informations.linkedin} target="_blank"><img src={linkedin} className="logo" /></a>
        <a href={jsonData.informations.codewars} target="_blank"><img src={codewars} className="logo" /></a>
      </div>
    </div>
  );
}

export default Banner;
